import styled from 'styled-components';
import Ul from './styles/ListStyles';

import Link from 'next/link';

const StyledNav = styled.nav`
  display: flex;
  justify-content: space-between;
  border-bottom: solid 0.2em gray;
  padding: 1.2em;
  margin: 0;
  .user-auth ul {
    display: flex;
    margin: 0;
    padding: 0;
    font-family: 'Quattrocento', serif;
  }

  .user-auth li {
    border: solid 1px #001f3f;
    padding: 1em;
  }

  .user-auth a {
    color: #111111;
    text-decoration: none;
  }
  li:first-child {
    margin-right: 1em;
  }

  .app-name {
    display: flex;
    align-items: center;
    margin-right: 1em;
  }
  .app-name p {
    margin: 0;
    padding: 0;
    font-family: 'Fredoka One', cursive;
    font-size: 1.8em;
  }

  /* .user-auth {
    border: solid 1px red;
  } */
`;

function Nav() {
  return (
    <StyledNav>
      <div className='app-name'>
        <p>Digital Library</p>
      </div>
      <div className='user-auth'>
        <Ul>
          <li id='signin'>
            <Link href='/signin'>
              <a>Sign in</a>
            </Link>
          </li>
          <li id='signup'>
            <Link href='/signup'>
              <a>Join Now</a>
            </Link>
          </li>
        </Ul>
      </div>
    </StyledNav>
  );
}

export default Nav;
